<li>同时也提供了 <code>IMAP/POP3/SMTP</code> 服务</li>
<li><code>Nginx</code> 是由伊戈尔·赛索耶夫为俄罗斯访问量第二的 <code>Rambler.ru</code> 站点（俄文： <code>Рамблер</code> ）开发的</li>
<li>其特点是占有内存少，并发能力强，事实上 <code>Nginx</code> 的并发能力在同类型的网页服务器中表现较好</li>
<li>中国大陆使用 <code>Nginx</code> 网站用户有：百度、京东、新浪、网易、腾讯、淘宝等</li>
<li><a href="http://nginx.org/en/download.html" target="_blank" rel="noopener noreferrer">http://nginx.org/en/download.html</a></li>
